function hasXdpSpace(dp) {
    var usedSpace = (236 + context.device.screenHeight * .25)
    return context.device.screenHeight >= (usedSpace + dp)
}

//context.device.locale == "en_US"  &&
hasXdpSpace(150) &&
context.device.locale.includes("_US")  &&
context.viewedLocation.country == "US" && 
context.weatherSummary.observation !== null &&
context.weatherSummary.observation.basedGPS == true &&
context.weatherSummary.closestLightning !== null &&
context.weatherSummary.closestLightning.distance !== null && 
context.weatherSummary.closestLightning.strikeTime != null

function hasXdpSpace(dp) {
    var usedSpace = (236 + context.device.screenHeight * .25)
    return context.device.screenHeight >= (usedSpace + dp)
}

hasXdpSpace(150) &&
context.weatherSummary.contentMode !== null &&
(context.weatherSummary.contentMode.mode == "severe1" || 
context.weatherSummary.contentMode.mode == "severe2") &&
(((context.device.locale == "en_US" || context.device.locale == "es_US") && 
context.viewedLocation.country == "US") ||
(context.device.locale == "de_DE" && context.viewedLocation.country == "GM"))

var phenomenaCodes = ["HU","HI","HF","TI","TR","TY"]
var severeCodes = ['W']

function isImpactedUser(){
   if(context.weatherSummary !== null && context.weatherSummary.nearestWinterStormAlert !== null){
       var alert = context.weatherSummary.nearestWinterStormAlert;
       var phenomenaCode = alert.phenomenaCode;
       var severityCode = alert.severityCode;

       return (phenomenaCodes.indexOf(phenomenaCode) !== -1) && (severeCodes.indexOf(severityCode) !== -1);
   }
   return false;
}

isImpactedUser()

function isValidLocaleAndViewingCountry() {
  return ((context.device.locale == "en_US" || context.device.locale == "es_US" ||
  context.device.locale == "en_MX" || context.device.locale == "es_MX") 
  && context.viewedLocation.country == "US");
}

isValidLocaleAndViewingCountry()

function isValidLocaleAndViewingCountry() {
  return ((context.device.locale == "en_US" || context.device.locale == "es_US" ||
  context.device.locale == "en_MX" || context.device.locale == "es_MX") 
  && context.viewedLocation.country == "US");
}

var severeCodes = ['A','S']
var phenomenaCodes = ["HU","HI","HF","TI","TR","TY"]

function isImpactedUser(){
   if(context.weatherSummary !== null && context.weatherSummary.nearestWinterStormAlert !== null){
       var alert = context.weatherSummary.nearestWinterStormAlert
       var phenomenaCode = alert.phenomenaCode;
       var severityCode = alert.severityCode;

       return (phenomenaCodes.indexOf(phenomenaCode) !== -1) && (severeCodes.indexOf(severityCode) !== -1);
   }
   return false;
}

isValidLocaleAndViewingCountry() && isImpactedUser()
